12325.script:
const socket = new WebSocket('ws://localhost:toPort');

// 接続ができた時にトリガーされる
socket.onopen = () => {
    console.log('Connected to server');
});

// サーバーのメッセージが受信された時にトリガーされる
socket.onmessage = (event) => {
    console.log("Received: " + event.data});
};

// 接続中止
socket.onclose = () => {
    console.log('Connection closed');
};

